import React from 'react'

function BlogInner() {
  return (
    <div>
    <section className='blog-banner'>
        <div className='col-md-9 col-sm-12 col-xs-12'>
            <div className='h2-heading white-color mb-xs-10'>Press Releases</div>
        </div>
    </section>
    </div>
  )
}

export default BlogInner
